  const titleStyle = useSpring({
    from: { opacity: 0},
    to: { opacity: 1 },
    delay: 1000
  })
  return (
    <div className="home">
      <HomeAnimation />
      <Logo />
      <animated.div 
        className="title"
        >
        <h1>Photograph's name</h1>
        <h3>Votre histoire</h3>
        <div className="home-btn">
          <NavLink path to='/about'>Cr√©er la votre</NavLink>
        </div>
      </animated.div>
    </div>
  );
};

export default Home;
